import React from 'react';
import { Menu } from 'antd';
import { Link } from 'react-router-dom';

export default function MenuReponsive() {
    return (
        <Menu theme='dark'>
            <Menu.Item key={0}>
                <Link to="/friend">Account</Link>
            </Menu.Item>

            <Menu.Item key={1}>
                <Link to="/history">Setting</Link>
            </Menu.Item>

            <Menu.Item key={2}>
                <Link to="/message">Logout</Link>
            </Menu.Item>
        </Menu>
    );
}
